import React from 'react'

function Header() {
    return (
        <div>
            <ul id="nav">
                <li data-menuanchor="firstPage" class="active"><a href="#firstPage">Hello</a></li>
                <li data-menuanchor="secondPage"><a href="#secondPage">About</a></li>
                <li data-menuanchor="thirdPage"><a href="#thirdPage">Skills</a></li>
                <li data-menuanchor="fourthPage"><a href="#fourthPage">Works</a></li>
                <li data-menuanchor="fourthPage"><a href="#fourthPage">Contact</a></li>
            </ul>
        </div>
    );
}

export default Header;
